import Navbar from "./Components/Navbar.js";
import {BrowserRouter, Routes, Route, Navigate} from "react-router-dom";
import {Home, NotFound} from "./Pages/PageImports.js";
function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home/>}/>
        <Route path="*" element={ <NotFound/> }/>
      </Routes>

    </BrowserRouter>
  );
}

export default App;
